काठमाडौं ।&nbsp;अजोड इन्स्योरेन्स नेसनल पेमेन्ट इन्टरफेसमा आवद्ध भएको छ । कम्पनीले आफ्नो भुक्तानी सम्बन्धी कारोबारहरूलाई नेपाल क्लियरिङ हाउसको भुक्तानी प्रणालीहरू&nbsp;प्रयोग गर्ने गरी दुई संस्था बीच सम्झौता भएको छ ।

सम्झौता पत्रमा अजोड इन्स्योरेन्सका प्रमुख कार्यकारी अधिकृत कुमारबहादुर खत्री र एनसीएचएलका प्रमुख कार्यकारी अधिकृत नीलेश मान सिंह प्रधानले हस्ताक्षर गरेका छन् ।&nbsp;

