काठमाडौं । एनएमबि बैंकले २६औँ वार्षिक साधारण सभा सम्पन्न गरेको छ । बैंकले&nbsp; बिहीबार सम्पन्न गरेको साधारणसभाबाट सञ्चालक समितिले प्रस्ताव गरेको लाभांश पारित गरेको छ ।

