हलिउड । पाराअमाउन्ट प्लस सिरिज &lsquo;स्टार ट्रेक :&nbsp;पिकार्ड&rsquo; को छायांकन स्थगित भएको छ । निर्माण&nbsp;टिमका ५० जना भन्दा बढीमा कोरोना संक्रमण देखिएपछि निर्माण स्थगित गरिएको हो ।

क्रिसमसपछि सोमबार मात्रै छायांकन पुनः सुरु गरिएको थियो । तर, पहिलो दिनमै यतिधेरै सदस्यमा कोरोना देखिएपछि निर्माण टिम छायांकन&nbsp;स्थगित गर्न बाध्य भएको हो ।&nbsp;

